// Home.js
import React from 'react';
import './Home.css';
import moniseDev from '../../assets/MoniseDev.jpg';

function Home() {
    return (
        <section className="home">
            <img src={MoniseDev} alt="Monise da Silva" className="fotoLogo"/>
            <div className="home-content">
                <h1>Olá, sou Monise Da Silva</h1>
                <p>Desenvolvedora de Sites & Sistemas, apaixonada por transformar ideias em soluções digitais
                    personalizadas.
                    Auxilio empresas e empreendedores a criarem uma presença online moderna e eficiente.</p>

                <p>Vamos inovar juntos? Exploro novas possibilidades para o seu projeto enquanto sigo minha trajetória
                    como desenvolvedora back-end.</p>

                <a href="#contato" className="cta-button">Entre em contato</a>
            </div>
        </section>
    );
}

export default Home;
